package bean;

public class cfbean {
	private String macafe;
	private String tencafe;
	private long soLuong;
	private long gia;
	private String anh;
	private String maLoai;
	public cfbean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public cfbean(String macafe, String tencafe, long soLuong, long gia, String anh, String maLoai) {
		super();
		this.macafe = macafe;
		this.tencafe = tencafe;
		this.soLuong = soLuong;
		this.gia = gia;
		this.anh = anh;
		this.maLoai = maLoai;
	}
	public String getMacafe() {
		return macafe;
	}
	public void setMacafe(String macafe) {
		this.macafe = macafe;
	}
	public String getTencafe() {
		return tencafe;
	}
	public void setTencafe(String tencafe) {
		this.tencafe = tencafe;
	}
	public long getSoLuong() {
		return soLuong;
	}
	public void setSoLuong(long soLuong) {
		this.soLuong = soLuong;
	}
	public long getGia() {
		return gia;
	}
	public void setGia(long gia) {
		this.gia = gia;
	}
	public String getAnh() {
		return anh;
	}
	public void setAnh(String anh) {
		this.anh = anh;
	}
	public String getMaLoai() {
		return maLoai;
	}
	public void setMaLoai(String maLoai) {
		this.maLoai = maLoai;
	}
	
	
}
